import Button from '@material-ui/core/Button';

import DeleteIcon from '@material-ui/icons/Delete';

const Notes = (props)=>{

    const deleteFun = ()=>{

        props.onpress(props.id);
    }
   
    return(
                         <>

                         <div className="Notes" >
                            <h3 style={{marginLeft:"25px" }}>{props.value.text}</h3>

                            <p h style={{ marginLeft:"25px" }} >{props.value.content}</p>

                            <DeleteIcon className="del" style={{ marginLeft:"25px" , color:"red"}} onClick={deleteFun}>  </DeleteIcon>
                         </div>
                        
                        </>);

}

export default Notes;
